import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  var selected = [-1, -1];
  var enPassantSquare = [-1, -1];
  var enPassantVictim = [-1, -1];
  var boardReady = true;
  var whiteTurn = true;
  var checkedColor = "";

  function boardSquare(args : object) {
      this.backColor = (args.backColor && args.backColor != "") ? args.backColor : "";
      this.isSelected = (args.isSelected && args.isSelected != "") ? args.isSelected : false;
      this.isHighlighted = (args.isHighlighted && args.isHighlighted != "") ? args.isHighlighted : false;
      this.piece = (args.piece && args.piece != "") ? args.piece : "";
      this.row = (args.row && args.row != "") ? parseInt(args.row) : 0;
      this.col = (args.col && args.col != "") ? parseInt(args.col) : 0;
      this.blackPressure = (args.blackPressure && args.blackPressure != "") ? parseInt(args.blackPressure) : 0;
      this.whitePressure = (args.whitePressure && args.whitePressure != "") ? parseInt(args.whitePressure) : 0;
      this.hasMoved = (args.hasMoved && args.hasMoved != "") ? args.hasMoved : false;
      this.enPassantColor = (args.enPassant && args.enPassant != "") ? args.enPassant : "";
      this.blockCheckColor = (args.blockCheckColor && args.blockCheckColor != "") ? args.blockCheckColor : "";
      this.whitePressureSource = (args.whitePressureSource && args.whitePressureSource != "") ? args.whitePressureSource : "";
      this.blackPressureSource  = (args.blackPressureSource  && args.blackPressureSource  != "") ? args.blackPressureSource : "";
      this.pinDir = (args.pinDir && args.pinDir != "") ? args.pinDir : "";
      this.inCheck = (args.inCheck && args.inCheck != "") ? args.inCheck : false;

      this.setClass = function () {
          var pieceClass = "boardBtn ";

          if (this.inCheck) {
              pieceClass += "inCheck";
          }
          else if (this.isSelected) {
              pieceClass += "selected";
          }
          else if (this.isHighlighted) {
              pieceClass += "highlighted " + this.backColor;
          }
          else {
              pieceClass += this.backColor;
          }

          if (this.piece && this.piece != "") {
              if (this.piece.indexOf('Pawn') != -1) {
              }

              pieceClass += " " + this.piece.split('|').join('');
          }

          $("#board" + this.col.toString() + this.row.toString()).attr('class', pieceClass);
      };
  }

  function SetClickField(i, j) {
      $('#<%=ClickedButton.ClientID%>').val(i + "|" + j);
  }

  document.addEventListener('DOMContentLoaded', function () {
      if (!document.getElementById("<%=WhiteDisplay.ClientID%>").firstChild) {
          document.getElementById("<%=WhiteDisplay.ClientID%>").style.display = 'none';
      }

      if (!document.getElementById("<%=BlackDisplay.ClientID%>").firstChild) {
          document.getElementById("<%=BlackDisplay.ClientID%>").style.display = 'none';
      }
  });

  var board = [];

  $(document).ready(function () {
      var whiteSquare = true;
      var whitePiece = false;
      var pieceOrder = [ "Rook", "Knight", "Bishop", "Queen", "King", "Bishop", "Knight", "Rook" ];
      var pieceClass = "";

      for (var i = 0; i < 8; i++) {
          board[i] = [];
          for (var j = 0; j < 8; j++) {
              var args = { };

              if (i == 0 || i == 7) {
                  args.piece = (whitePiece ? "white|" : "black|") + pieceOrder[j];
              }
              else if (i == 1 || i == 6) {
                  args.piece = whitePiece ? "white|Pawn" : "black|Pawn";
              }

              args.col = i;
              args.row = j;
              args.backColor = (whiteSquare ? "white" : "black");

              board[i][j] = new boardSquare(args);

              pieceClass = board[i][j].backColor + " boardBtn";

              if (args.piece && args.piece != "") 
              {
                  pieceClass += " " + args.piece.split('|').join('');
              }

              $(`<div id="board` + i.toString() + j.toString() + `" class='` + pieceClass + `' onclick="boardClick('` + args.col + `', '` + args.row + `')"></div>`).appendTo($(".GameBoard"));


              whiteSquare = !whiteSquare;
          }

          if (i == 1) {
              whitePiece = !whitePiece;
          }

          whiteSquare = !whiteSquare;
      }

  });

  function boardClick(col, row) {
      if (!boardReady || ((board[col][row].piece.split('|')[0] != "white") && !board[col][row].isHighlighted)) {
          return;
      }

      boardReady = false;
      $.ajax({
          url: "../api/chess",
          method: "POST",
          data: {
              board: JSON.stringify(board),
              selected: JSON.stringify(selected),
              enPassantSquare: JSON.stringify(enPassantSquare),
              enPassantVictim: JSON.stringify(enPassantVictim),
              col: col,
              row: row,
              checkedColor: checkedColor
          },
          success: function (data) {
              buildBoard(data);

              if (!whiteTurn) {
                  $.ajax({
                      url: "../api/chess",
                      method: "POST",
                      data: {
                          board: JSON.stringify(board),
                          enPassantSquare: JSON.stringify(enPassantSquare),
                          enPassantVictim: JSON.stringify(enPassantVictim),
                          checkedColor: checkedColor,
                          compTurn: true
                      },
                      success: function (data) {
                          buildBoard(data);
                          boardReady = true;
                      }
                  });
              }
              else {
                  boardReady = true;
              }
          }
      });
  }

  function buildBoard(data) {
      var args = {
          isSelected: false,
          isHighlighted: false,
          piece: "",
          row: "",
          col: "",
          blackPressure: 0,
          whitePressure: 0,
          hasMoved: false,
          enPassantColor: "",
          backColor: "",
          pinDir: "",
          inCheck: false,
          blockCheckcolor: "",
          checkmate: false,
          whitePressureSource: "",
          blackPressureSource: ""
      };

      selected = [];
      enPassantVictim = [-1, -1];
      enPassantSquare = [-1, -1];
      checkedColor = "";

      for (var i = 0; i < 8; i++) {
          for (var j = 0; j < 8; j++) {
              var index = (i * 8) + j;
              var square = data[index];

              args.isSelected = square.isSelected;
              args.isHighlighted = square.isHighlighted;
              args.hasMoved = square.hasMoved;
              args.enPassantColor = square.enPassantColor;
              args.blackPressure = square.blackPressure;
              args.whitePressure = square.whitePressure;
              args.col = square.coords[0];
              args.row = square.coords[1];
              args.pinned = square.pinned;
              args.blockCheckColor = square.blockCheckColor;
              args.checkmate = square.checkmate;
              args.whitePressureSource = square.whitePressureSource;
              args.blackPressureSource = square.blackPressureSource;
              args.inCheck = square.inCheck;
              args.pinDir = square.pinDir;

              if (square.moved) {
                  whiteTurn = !whiteTurn;
              }

              if (args.inCheck) {
                  checkedColor = square.piece.color;
              }

              if (square.piece && square.piece !== null) {
                  args.piece = square.piece.color + "|" + square.piece.type;
              }
              else {
                  args.piece = "";
              }

              if (square.isSelected) {
                  selected = [parseInt(square.coords[0]), parseInt(square.coords[1])];
              }

              if (args.checkmate) {
                  alert('checkmate ' + square.piece.color);
              }

              if (square.enPassantColor != "" && square.enPassantVictim != null) {
                  enPassantSquare = square.coords;
                  enPassantVictim = [parseInt(square.enPassantVictim[0]), parseInt(square.enPassantVictim[1])];
              }

              args.backColor = board[i][j].backColor;

              board[i][j] = new boardSquare(args);
              board[i][j].setClass();
          }
      }
  }

  return (
    <>
      <div className="pieceDisplay" id="WhiteDisplay"></div>
      <div id="GameBoard" className="GameBoard"></div>
      <div className="pieceDisplay" id="BlackDisplay"></div>
    </>
  );
}

export default App;
